import React from "react"

const Landing = () => {
  return (
    <div
      css={[
        tw`flex flex-col`,
        css`
          backgroundimage: url(./assets/images/pikachu.jpg);
        `,
      ]}
    >
      POKEMON
    </div>
  )
}

export default Landing
